import React from "react";
import PropTypes from "prop-types";
import { Col, Row } from "antd";

const Skill = () => {
  return (
    <Row>
      <Col
        style={{ backgroundColor: "blue", width: "400px", height: "50px" }}
      ></Col>
    </Row>
  );
};

Skill.propTypes = {
  character: PropTypes.string,
};

export default Skill;
